import logo_1 from './images/logo_1.jpg';
import logo_2 from './images/logo_2.jpg';
import 'bootstrap/dist/css/bootstrap.min.css';

const Nav = () => {
    return(
        <nav className="navbar navbar-expand-sm navbar-light bg-light p-0">
            <a href='/' className='navbar-brand mb-0 h1'>
                <img src={logo_1} alt="Logo" width="40"/>
                <img src={logo_2} alt="Logo"  width="50" height="45"/>
            </a>

            <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
            </button>

            <div className="collapse navbar-collapse" id='navbarNav'>
            <ul className="navbar-nav">
                <li className="nav-item active">
                    <a href="/" className="nav-link">
                        Home
                    </a>
                </li>
                <li className="nav-item active">
                    <a href="/" className="nav-link">
                        About</a>
                </li>
            </ul>
            </div>

        </nav>
    );
}

export default Nav;
